contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"axis":{"id":"1122"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1125","type":"Grid"},{"attributes":{},"id":"1082","type":"LinearScale"},{"attributes":{},"id":"1159","type":"CategoricalScale"},{"attributes":{},"id":"1288","type":"LinearScale"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"1243","type":"Line"},{"attributes":{},"id":"1457","type":"UnionRenderers"},{"attributes":{"coordinates":null,"formatter":{"id":"1207"},"group":null,"major_label_orientation":-0.5,"major_label_policy":{"id":"1456"},"minor_tick_line_alpha":0,"ticker":{"id":"1209"}},"id":"1193","type":"LinearAxis"},{"attributes":{},"id":"1161","type":"CategoricalScale"},{"attributes":{"bottom":{"field":
